  false,\n\t\"url\": null,\n\t\"notes\": \"The goals of this study were to further
  investigate the suitability of brackish marshes in south San Francisco Bay to support
  breeding rails and to examine how the abundance of breeding rails may vary within
  different sub-habitats of a saltmarsh. An additional objective was to establish
  vegetational transects which will provide a means of characterizing different marshes
  in the south bay. and monitoring longterm saltmarsh vegetation changes.\",\n\t\"license_title\":
